{Soil_remains_in_ball_when_squeezed}
Place approximately 25 g soil in palm. Add water dropwise and knead the soil to break down all aggregates. Soil is at the proper consistency when plastic and moldable, like moist putty.  {TASK__Roll_ribbon}
Rub a ball of soil between thumb and forefinger to make a 'ribbon' {Does_NOT_form_a_ribbom}
A 'ribbon' is NOT formed when a ball of soil is rubbed between thumb and forefinger.  {Loamy_Sand}
In a loamy sand particles barely stick together and a moulded piece of soil just holds its shape. (VDEPI 2009: AG0058) {Forms_ribbon}
A 'ribbon' is formed when a ball of soil is rubbed between thumb and forefinger.  {Medium_ribbon__2_5_5cm_long_}
The ribbon formed when a ball of soil is rubbed between thumb and forefinger is between 2.5 and 5cm long.  {TASK__Wet_soil_and_rub_with_forefinger}
Excessively wet a small pinch of soil in palm and rub with forefinger.  {Does_NOT_feel_very_gritty}
The wetted soil does NOT feel very gritty when rubbed on the palm and with forefinger.  {Feels_very_smooth}
The wetted soil feels very smooth when rubbed on the palm and with forefinger.  {Silty_Clay_Loam}
A silty clay loam is like a clay loam but silty as well and smooth to the touch. (VDEPI 2009: AG0058) {Neither_very_gritty_nor_very_smooth}
The wetted soil does NOT feel very smooth nor very gritty when rubbed on the palm and with forefinger.  {Clay_Loam}
More easily moulded into a shape than a loam, a clay loam rolls out to a thin ribbon between the palms while a loam will break-up. When dry a clay loam will form a lump but is not as tough to break as a clay.(VDEPI 2009: AG0058) {Feels_very_gritty}
The wetted soil feels very gritty when rubbed on the palm and with forefinger.  {Sandy_Clay_Loam}
A sandy clay loam is like a clay loam but sand grains can be felt (and heard - see Sandy Loam) (VDEPI 2009: AG0058) {Strong_ribbon}
The ribbon formed when a ball of soil is rubbed between thumb and forefinger is strong and over 5cm long.  {TASK__Wet_soil_and_rub_with_forefinger}
Excessively wet a small pinch of soil in palm and rub with forefinger.  {Does_NOT_feel_very_gritty}
The wetted soil does NOT feel very gritty when rubbed on the palm and with forefinger.  {Feels_very_smooth}
The wetted soil feels very smooth when rubbed on the palm and with forefinger.  {Silty_Clay}
A silty clay is like a clay but smoother. (VDEPI 2009: AG0058) {Neither_very_gritty_nor_very_smooth}
The wetted soil does NOT feel very smooth nor very gritty when rubbed on the palm and with forefinger.  {Clay}
Clays are tough and can be moulded into shapes when moist. Clays form a long flexible ribbon when rubbed between the palms and the ribbon can often be bent into a U shape without breaking. Clays dry into very hard clods. (VDEPI 2009: AG0058) {Feels_very_gritty}
The wetted soil feels very gritty when rubbed on the palm and with forefinger.  {Sandy_Clay}
A sandy clay is like a clay but sand grains can be felt (and heard - see Sandy Loam). (VDEPI 2009: AG0058) {Weak_ribbon___2_5cm_long_}
The ribbon formed when a ball of soil is rubbed between thumb and forefinger is less than 2.5cm long.  {TASK__Wet_soil_and_rub_with_forefinger}
Excessively wet a small pinch of soil in palm and rub with forefinger.  {Does_NOT_feel_very_gritty}
The wetted soil does NOT feel very gritty when rubbed on the palm and with forefinger.  {Feels_very_smooth}
The wetted soil feels very smooth when rubbed on the palm and with forefinger.  {Silt_Loam}
A silty loam is like a loam but has a smooth silky feel when a moist sample is pushed between the index finger and thumb. On drying a sample can form a hard lump but this may be broken by hand. (VDEPI 2009: AG0058) {Neither_very_gritty_nor_very_smooth}
The wetted soil does NOT feel very smooth nor very gritty when rubbed on the palm and with forefinger.  {Loam}
A loam breaks into crumbs but will tend to stick together. Sand grains cannot be felt in a moist sample which when squeezed will retain its shape when handled freely. Loams are usually soft to the feel. (VDEPI 2009: AG0058) {Feels_very_gritty}
The wetted soil feels very gritty when rubbed on the palm and with forefinger.  {Sandy_Loam}
A sandy loam sticks together more than a loamy sand but can be easily broken. Individual sand grains can be felt and heard if a wet sample is rubbed between the index finger and thumb and held close to the ear. (VDEPI 2009: AG0058)
